import{_ as n}from"./plugin-vue_export-helper-c27b6911.js";import{r,o as l,c,a,b as t,w as o,d,e as i}from"./app-4086ba32.js";const s={},h=d('<h2 id="介绍" tabindex="-1"><a class="header-anchor" href="#介绍" aria-hidden="true">#</a> 介绍</h2><p>雪镇社区和雪镇战略局</p><blockquote><p>Snowtown Community and Strategic Homeland Division</p></blockquote><div class="hint-container info"><p class="hint-container-title">社区制度</p><p>独裁制</p></div><p>雪镇社区是由玩家Ritmo，ZERO_XKRT，eoe共同创立的独裁制社区。</p><p>社区为卡兹戴尔社区附属。本社区分为两个部分，分别是由Ritmo主管的小镇区和ZERO_XKRT主管的军事区。</p><p>小镇区起居住、交易、行政的作用；而军事区则是为社区军事组织“国土战略局雪镇分部”（下文简称“雪镇战略局”）的基地。小镇区崇尚自由，友好，和谐共处的理念。对于所有爱好和平的人都进行接纳和宽容，严禁打架斗殴、盗窃等违法犯罪行为。</p><p>社区暂定货币为金锭、金粒、金块，不排除以后会加入或替换为铜锭。</p><p>虽附属于卡兹戴尔，但雪镇拥有高度自治权。除非经过雪镇全体公民的同意，否则卡兹戴尔不能干涉雪镇内政。</p><h2 id="成员" tabindex="-1"><a class="header-anchor" href="#成员" aria-hidden="true">#</a> 成员</h2><ul><li>Ritmo（社区元首）</li><li>ZERO_XKRT（军事区管理人及雪镇战略局指挥官）</li><li>eoe（元首辅助官）</li></ul><h2 id="官方机构" tabindex="-1"><a class="header-anchor" href="#官方机构" aria-hidden="true">#</a> 官方机构</h2><p>由于雪镇刚刚成立，人数较少，精力不多，并且付属于卡兹戴尔，因此大使馆将与卡兹戴尔共用，这点请敬请理解。</p><p>雪镇战略局基地是集军事，医疗，存储为一体的军事基地，目前用于雪镇战略局的总部。基地目前不对平民及其它社区的人开放，仅允许战略局特工进入，如果贸然闯入只会招致危险。</p><h2 id="法规" tabindex="-1"><a class="header-anchor" href="#法规" aria-hidden="true">#</a> 法规</h2>',15);function p(_,u){const e=r("RouterLink");return l(),c("div",null,[h,a("p",null,[t(e,{to:"/law/kfc.html"},{default:o(()=>[i("卡兹戴尔疯人院法规")]),_:1})]),a("p",null,[t(e,{to:"/law/shd-st.html"},{default:o(()=>[i("雪镇战略局军事条例")]),_:1})])])}const R=n(s,[["render",p],["__file","snow.html.vue"]]);export{R as default};
